import React from 'react'
import Questions from './Questions'

class GameContainer extends React.Component {
  constructor(){
    super()

    this.state ={
      score: 0,
    }
  }

  render(){
    return (
      <div>
        <h1>Lutrivia</h1>
        <button>New Game</button>
        <h2>Score:{this.state.score}</h2>
        <Questions />
      </div>
    )
  }
}

export default GameContainer
